import { ADD_EXPENSE } from "./constants/action-type";

const initialState = {
  expenses: []
};

const expenseReducer = (state = initialState, action) => {
  let user
  switch (action.type) {
    case ADD_EXPENSE:
      user = action.payload
      return { ...state, user }
    default:
      return state;
  }
}
export default expenseReducer;
